import React from 'react';
import { NavLink } from 'react-router-dom';
const Navigation = () => {
    return (
        <div className="Navigation">
            <ul>
                <NavLink to="/">
                    <li>Accueil</li>
                </NavLink>
                <NavLink to="/Detail">
                    <li>Detail</li>
                </NavLink>
                <NavLink to="/Result">
                    <li>Resultat</li>
                </NavLink>
            </ul>
        </div>
    );
};

export default Navigation;
